import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

// Components
import Configuration from "../pages/Configuration.jsx";

const router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/configuration" element={<Configuration />} />
      </Routes>
    </BrowserRouter>
  );
};

export default router;
